var index = 0;

setInterval(function image_changer() 
{
	if (index === image_data.length)
	{
		index = 0;
	}

	document.getElementById('image').src = image_data[index];
	index = index + 1;
},2000);


tabcontent = document.getElementsByClassName("tabcontent");
